import 'package:flutter/material.dart';

class ListViewAssignmentDemo extends StatelessWidget {
  const ListViewAssignmentDemo({Key? key}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    List<List<String>> cricketPlayerList = [
      [
"https://upload.wikimedia.org/wikipedia/commons/e/ef/Virat_Kohli_during_the_India_vs_Aus_4th_Test_match_at_Narendra_Modi_Stadium_on_09_March_2023.jpg",
"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTWe9Akz8eHGslio8Eno9ln5DYJkZeVo_LCuiqs9yeK8Q&s",
"https://upload.wikimedia.org/wikipedia/commons/c/cc/Rohit_Gurunath_Sharma.jpg",
 ],
 [
"data:image/jpeg;base64,",
"data:image/jpeg;base64,",
"data:image/jpeg;base64,"
 ],
      [
"data:image/jpeg;base64,",
"data:image/jpeg;base64,",
"data:image/jpeg;base64,"
 ],
    ];

    return Scaffold(
      appBar: AppBar(
        title: Text('Nested ListView Example'),
      ),
      body: ListView.builder(
        itemCount: cricketPlayerList.length,
        itemBuilder: (context, index) {
          return Card(
            margin: EdgeInsets.all(10),
            child: Padding(
              padding: EdgeInsets.all(10),
              child: Column(
                crossAxisAlignment: CrossAxisAlignment.start,
                children: [
                  Text(
                    'Team ${index + 1}',
                    style: TextStyle(
                      fontSize: 20,
                      fontWeight: FontWeight.bold,
                    ),
                  ),
                  SizedBox(height: 10),
                  ListView.builder(
                    shrinkWrap: true,
                    physics: NeverScrollableScrollPhysics(),
                    itemCount: cricketPlayerList[index].length,
                    itemBuilder: (context, innerIndex) {
